import React, { Component } from "react"
import Searchbar from "./Searchbar"
import Logo from "./Logo"

class Navbar extends Component {
  constructor() {
    super()
    this.state = {}
  }
  render() {
    return (
      <label>
        <p className="logoText">GG</p>
      </label>
    )
  }
}
export default Navbar
